@mixin custom-base-btn($width) {
  display: block;
  width: $width;
  border-radius: 6px;
  outline: none;
  border:none;
  font-style: normal;
  font-weight: normal;
  font-size: 1.6rem;
  line-height: 1.9rem;
  text-align: center;
  color: #FFFFFF;
  padding: 1.8rem 0;
  margin: 0 auto;
  transition: all 0.3s;

  &:disabled {
    opacity: 0.5;
  }

  &.ripple {
    background-position: center;
    transition: all 0.8s;
  }

  &.ripple:active {
    background-size: 100%;
    transition: all 0.3s;
  }
}

@mixin custom-color-btn ($bg-color, $shadow){
  background-color: $bg-color;
  border: 1px solid $bg-color;
  box-shadow: 0px 3px 4px $shadow;

  &.ripple:hover {
    background: $bg-color radial-gradient(circle, transparent 5%, $bg-color 5%) center/15000%;
  }

  &.ripple:active {
    background-color: lighten($bg-color, 5%);
    background-size: 100%;
    transition: background 0s;
  }
}

@mixin objectFitImg($size) {
  width: $size;
  height: $size;
  min-width: $size;
  object-position: center top;
  object-fit: cover;
  border-radius: 50%;
}

@mixin svgStyle($size, $fill) {
  width: $size;
  height: $size;
  fill: $fill;
}

@mixin svgAsBgi($width, $height, $url) {
  width: $width;
  height: $height;
  max-width: $width;
  background-position: 0 0;
  background-size: contain;
  background-repeat: no-repeat;
  background-image: url($url);
}

