    .search-input {
      flex-grow: 1;
      font-weight: 300;
      font-size: 12px;
      line-height: 15px;
      color: rgba(0, 0, 0, 1);
      border: none;
      background: rgba(44, 44, 44, 0.11);
      border-radius: 3px;
      padding: 0.6rem 1.5rem;
